import {useState,useEffect} from 'react';
const Verify=()=>{
    const [email,setEmail]=useState("");
    const [code,setCode]=useState("");


    useEffect(function(){
        let x=localStorage.getItem("infos");
        x=JSON.parse(x);
        setEmail(x.email);
        setCode(x.code);
    },[]);
    return(
        <div>
            {email}<br></br>
            {code}
        </div>
    )
}
export default Verify;
